import React from 'react';

import "../styles/SearchResults.css";

const SearchResults = ({ results, onResultClick }) => {
  return (
    <div>
      {results.map((result) => (
        <div key={result.objectID} className="mb-2">
          div
          <div onClick={() => onResultClick(result)} className="text-blue-500">
            
          </div>
        </div>
      ))}
    </div>
  );
};

export default SearchResults;
